import css from 'styled-jsx/css';

export default <style jsx>{`
  body {
    margin: 10px;
    padding: 5px;
    color: #669;
  }
  header {
    font-size: 64pt;
    font-weight:bold;
    text-align: right;
    letter-spacing: -8px;
    color:#ddddff;
    margin: -32px 5px;
  }
  footer {
    color: #99c;
    font-size: 12pt;
    text-align:right;
    border-bottom: 1px solid #99c;
    margin:50px 0px 10px 0px;
    bottom: 10px;
    right: 10px;
    left: 10px;
  }
  h1 {
    font-size:22pt;
    font-weight: bold;
    text-align: left;
    letter-spacing: 0px;
    color:#77a;
    margin:-50px 0px 50px 0px;
  }
  p {
    margin: 0px;
    color: #669;
    font-size: 16pt;
  }
  .circledata {
    width: 200px;
  }
  .circledata text {
    font-size: 0.5rem;
  }
  .circle {
    width: 10px;
    height: 10px;
    border-radius: 50%;
    background: #C13C37;
  }
  .list-wrap {
    list-style:  none;  /* デフォルトのアイコンを消す */
    margin:  0;         /* デフォルト指定上書き */
    padding: 0;         /* デフォルト指定上書き */
  }


  li span {
    color: #222222;
  }
  .circle1 {
    color: #C13C37;
  }
  .circle2 {
    color: blue;
  }
  .circle3 {
    color: grey;
  }
`}</style>
